Had a great chat with @studio10au about my upcoming episode of #ghostscbs @ghostscbs great interview 

Also touched on my new project ‘Walking In LA’ more to come on that.

@ashergrodman is amazing and I loved working with him and the rest of the cast 💜 #TaraReid #cbsghosts

It’s Tara Time! Catch the icon herself as @tarareid joins @ghostscbs this Thursday and makes Trevor’s dreams come! 

This week’s episode entitled “Trevor’s Body” was written by the hilarious @imurphy21 - seriously, I laughed so hard that I cried at the table read - and was directed by @alexhardcastle1 who rocked it!PLUS this episode features the work of some brilliant guest stars: @betsysodaro @johnlhartman @larainenewman #chipzien @chris.eckert #christiandaoust @tarareid #melissacarter

Trevor’s Body airs this Thursday at 8:30pm on @cbstv or anytime on @paramountplus 

Congratulations to our showrunners - @joeport & @emailwiseman - and our writers room:

@treykollmer @johnblickstead 
@kalushy @myjtim @emilyrschmidt @jmalmuth @sophia3000_ @guy.endore.kaiser @tbernstein @londonbridges___ @rishichitkara @imurphy21 @tyler_phelan @liz.probably 

@cbstv @cbstvstudios @paramountplus @paramountco @lionsgatetv @bbcstudiosla #shalom

